import './App.css';
import 'tachyons';
import { Logo } from '@auth0/cosmos';
import Main from './components/Main';

function App() {
  return (
    <div className="App">
      <Main />
      <h1 id="welcome">Welcome to the Coffee Teapots!</h1>
      <p>powered by</p>
      <Logo />
    </div>
  );
}

export default App;
